function initBotPanel() {
    const editor = document.getElementById('script-editor');

    document.getElementById('load-script-btn').onclick = () => {
        document.getElementById('script-file-input').click();
    };

    document.getElementById('script-file-input').onchange = (e) => {
        const file = e.target.files[0];
        if (file) {
            const reader = new FileReader();
            reader.onload = () => {
                editor.value = reader.result;
                logToScriptPanel(`Loaded script: ${file.name}`);
            };
            reader.readAsText(file);
        }
    };

    document.getElementById('start-script-btn').onclick = () => {
        try {
            const scriptCode = editor.value;

            // Reset previous script
            resetUserScript();

            // Evaluate the new script as an object with `init` and `run` methods
            const scriptObj = eval(`(${scriptCode})`);

            if (typeof scriptObj.run !== 'function') {
                throw new Error("Script must have a 'run(packet)' method.");
            }

            userScriptFunc = scriptObj;
            userScriptActive = true;

            if (typeof userScriptFunc.init === 'function') {
                userScriptFunc.init();
            }

            logToScriptPanel("User script started.");
        } catch (e) {
            logToScriptPanel(`Error in user script: ${e.message}`);
        }
    };

    document.getElementById('stop-script-btn').onclick = () => {
        resetUserScript();
        logToScriptPanel("User script stopped.");
    };

    document.getElementById('save-script-btn').onclick = () => {
        const blob = new Blob([editor.value], { type: "text/javascript" });
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.download = "user-script.js";
        link.click();
    };
}

async function initializeRuneAgent() {
    await loadCSS('styles.css');
    await loadHTML('log-panel.html', 'body');
    initPanels();
    initBotPanel();
}

document.readyState === "loading"
    ? document.addEventListener("DOMContentLoaded", initializeRuneAgent)
    : initializeRuneAgent();

let eventDataList = [];

function grabEventData(data, length) {
    const eventData = {
        timestamp: Date.now(),
        length: length,
        data: data
    };

    // Insert and sort by timestamp
    eventDataList.push(eventData);
    eventDataList.sort((a, b) => a.timestamp - b.timestamp);

    console.log(eventData);
}

function dumpEventDataToFile() {
    if (eventDataList.length === 0) return;

    eventDataList.forEach((event, index) => {
        const jsonString = JSON.stringify(event.data);
        const blob = new Blob([jsonString], { type: "application/json" });

        const a = document.createElement("a");
        a.href = URL.createObjectURL(blob);
        a.download = `event_file_${event.timestamp}.json`;
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(a.href);
    });

    // Reset the list
    eventDataList = [];
}

